                        <div class="faq__slider-container js-faq-slider owl-carousel">
                            <div class="faq__slider-item">
                                <div class="faq__slider-title">Какая общая последовательность разработки веб сайта?</div>
                                <div class="faq__slider-text">Сбор бизнес-требований ->  Аналитика -> Проектирование -> Дизайн -> Программирование -> Тестирование -> Запуск проекта -> Обучение и поддержка.</div>
                            </div>
                            <div class="faq__slider-item">
                                <div class="faq__slider-title">Какую вы предоставляете гарантию на разработанный продукт?</div>
                                <div class="faq__slider-text">Гарантия на наши работы - 1 год. И еще мы  всегда работаем по договору, в котором четко прописаны все условия нашей работы: срок выполнения, этапы, порядок согласования и т.д. Поэтому вы можете быть уверены на 100%, что все обязательства будут выполнены в полном объеме.</div>
                            </div>

                            <div class="faq__slider-item">
                                <div class="faq__slider-title">Сколько вариантов дизайна вы делаете в рамках договора?</div>
                                <div class="faq__slider-text">Мы совместно с клиентом продумываем дизайн-концепцию будущего продукта и подготавливаем референсы. Далее дизайнер готовит и презентует 2 варианта главной страницы.</div>
                            </div>

